//import
import '../../../styles/loc.css';
//function
const Ylocations = () =>{
    return(
        <div>
            <h2 className="main-heading">Locations:</h2>
            <div className="locations-container">
                <ul className="locations-list">
                    <li>Nablus</li>
                    <li>Jenin</li>
                    <li>Tulkarem</li>
                </ul>
        </div>
    </div>
    )
}

//export
export default Ylocations
